import React, { Component } from "react";

class Project extends Component {
  render() {
    return (
      <React.Fragment>
        <h1>Project {this.props.projects.id}</h1>
        <h3>Name: {this.state.project.shortname}</h3>
      </React.Fragment>
    );
  }
}

export default Project;
